import jxl.*

//fetch xls file
def filepath = "C:/Users/RADHIKAMADHANA/Desktop/SDET/API/Project/SunilData/CustomersList.xls"
File Excel = new File(filepath)
//fetch workbook and sheet 
Workbook wb = Workbook.getWorkbook(Excel)
Sheet sh = wb.getSheet("Sheet1")
def rowsize = sh.getRows().toInteger();
def colsize = sh.getColumns().toInteger();
//log.info "$rowsize and $colsize"
def email, firstName,lastName
//fetch values 
log.info "$rowsize"
log.info "$colsize"
for(i=0; i<rowsize; i++ )
{
	for(j=0;j<colsize;j++)
	{
		if(j==0)
		{
			email = sh.getCell(j,i).getContents()
			log.info "$email"
		}
		else if(j==1)
		{
			firstName = sh.getCell(j,i).getContents()
			log.info "$firstName"
		}
		else
		{
			lastName = sh.getCell(j,i).getContents()
			log.info "$lastName"
		}
	}
	// get TestCase
def tc = testRunner.testCase.testSuite.project.testSuites["APIProjectCustomer"].testCases["DataDrivenTestCase"]

// set credential properties from the script itself
tc.testSteps["CustDetail"].setPropertyValue("emailID", email )
tc.testSteps["CustDetail"].setPropertyValue("firstName", firstName )
tc.testSteps["CustDetail"].setPropertyValue("lastName", lastName )

// run test synchrouously
